"""
ids : {
    id1:{
        x : []
        y : []
        Start = n
    }
}
"""

def seq_extraction(ids):


    throws = []
    for key in ids:
        elem = ids[key]
        # Esto interpola las posiciones donde en vez de una coordenada se tiene None
        elem['y'] = pandas.Series(elem['y']).interpolate().values.round(2).tolist()
        # Son máximos porque las coordenadas se cuentan desde arriba
        local_mins = argrelmax(np.array(elem['y']), order=2)[0]
        for min in local_mins:
            throws.append((elem['Start']+min,key))
    
    throws.sort()

    return [y for _,y in throws]

def cambio_direccion(coord_anterior, coord_actual, coord_posterior):
    pendiente_ant = (coord_actual - coord_anterior)
    pendiente_post = (coord_posterior - coord_actual)
    return pendiente_ant * pendiente_post <= 0

def seq_extraction_cuadrants(ids, point, img_threshold, img_width):
    keys_info = {}
    for key in ids:
        tmp = {}
        tmp['last_dir'] = 'u'
        tmp['prev_x_dist'] = None
        tmp['prev_y_dist'] = None
        tmp['throw_counted'] = False
        tmp['posible_throw_frame'] = 0
        tmp['posible_throw_dir'] = (0, 'u')
        keys_info[key] = tmp
    throw_order = []
    throw_frames = []
    for num_frames in range(1, len(ids[1]['x'])+1):
        for key, coords in ids.items():
            curr_x = coords['x'][num_frames-1]
            curr_y = coords['y'][num_frames-1]

            point_x, point_y = point
            # Si el número de frame coincide con uno de los números de la lista, resalta los bordes en rojo
            # Distancias entre los ejes y nuestras coordenadas para comprobar si los cruzamos
            curr_x_dist = curr_x - point_x
            curr_y_dist = curr_y - point_y
            if keys_info[key]['posible_throw_frame'] != 0 and abs(curr_x_dist) > img_threshold:
                throw_frames.append((num_frames-1, key))
                keys_info[key]['posible_throw_frame'] = 0
                #print(keys_info[key]['posible_throw_dir'])
                throw_order.append(keys_info[key]['posible_throw_dir'])
            if keys_info[key]['throw_counted'] == False and keys_info[key]['prev_x_dist'] != None: # Si no es la primera iteración o no hemos contado ya este lanzamiento
                if curr_x_dist * keys_info[key]['prev_x_dist']<=0: # Cruzar el eje vertical en cualquiera de las dos direcciones cambia el signo de esta multiplicación
                    keys_info[key]['throw_counted'] = True
                    keys_info[key]['posible_throw_frame'] = num_frames
                    detect_flag = True
                    # Comprueba la mano que ha realizado el lanzamiento
                    if curr_x_dist < 0:
                        keys_info[key]['last_dir'] = 'l'
                    elif curr_x_dist > 0:
                        keys_info[key]['last_dir'] = 'r'
                    elif curr_x_dist == 0:
                        if keys_info[key]['last_dir'] == 'r':
                            keys_info[key]['last_dir'] = 'l'
                        else:
                            keys_info[key]['last_dir'] = 'r'
                    keys_info[key]['posible_throw_dir'] = (num_frames, keys_info[key]['last_dir'])

                elif keys_info[key]['prev_y_dist'] > 0 and curr_y_dist <= 0: # Cruzar el eje vertical de abajo a arriba cumple esto
                    keys_info[key]['throw_counted'] = True
                    keys_info[key]['posible_throw_frame'] = num_frames
                    detect_flag = True
                    # Comprueba la mano que ha realizado el lanzamiento
                    if curr_x_dist < 0:
                        keys_info[key]['last_dir'] = 'r'
                    elif curr_x_dist > 0:
                        keys_info[key]['last_dir'] = 'l'
                    keys_info[key]['posible_throw_dir'] = (num_frames, keys_info[key]['last_dir'])
            else:
                if num_frames > 2 and cambio_direccion(coords['x'][num_frames-2],curr_x,coords['x'][num_frames]): # Comprueba los cambios de dirección para saber si se ha hecho otro lanzamiento
                    keys_info[key]['throw_counted'] = False

            keys_info[key]['prev_x_dist']= curr_x_dist
            keys_info[key]['prev_y_dist'] = curr_y_dist
    throw_order = [elem[1] for elem in sorted(throw_order, key=lambda x: x[0])] #Ordena según el número de frames y despues los quita para dejar solo las manos que hacen los lanzamientos
    num_misses = sum(1 for i in range(len(throw_order) -1) if throw_order[i] == throw_order[i+1])

    throw_ids = [elem[1] for elem in sorted(throw_frames, key=lambda x: x[0])]

    return throw_ids, num_misses



